text:
Os caras estão mais constantes do que os últimos times que foram campeões mais com vários asteriscos...
* Faz muito tempo que não ganham o brasileiro;
* Segundo muito dinheiro gringo investido;
Ou seja não impressiona tanto o que eles vem fazendo, e se impressiona bom ai já da pra perceber que ninguém espera muita coisa do Botafogo mesmo a não ser a própria torcida...
